import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter} from 'react-router-dom'
import App from './App';
import UserProvider from './context/UserProvider'
import './css/styles.css'

ReactDOM.render(
  <BrowserRouter>
  <UserProvider>
    <App />  
  </UserProvider>
  </BrowserRouter>,
  document.getElementById('root')
);
